script: |
  super -f text -I q3149.spq | sort > q3149.out

inputs:
  - name: q3149.spq
    data: |
      SELECT ALL + 14 FROM tab1 (FORMAT parquet) AS cor0 WHERE - - col1 - - - col1 BETWEEN + 26 * + - col1 AND + + 55 OR NOT NULL IS NOT NULL;
  - name: tab1

outputs:
  - name: q3149.out
    data: |
      14
      14
      14
